clcclearmore offprintHeader(mfilename)##UN = 400; w3 = sqrt(3.0); Upro = UN/100; dUmax = Upro*5; NH=1;l1 = 80;l24 = 50; l23= 70; l22 = 70; l21= 50;l3 = 25;  l32 = 20;A1 = 120;A2 = 70;A3 = 35;A32 = 10;PM = 22e3;cp = 0.87;eta = 0.91;Sk = 400e6;St = 400e3;function ret = ITeiler(I,R1,R2)  ret = I * R1/(R1+R2);endfunction##Zl3 = ZsNYYc(A3) * l3/1000Zl32 = ZsNYYc(A32,4) * l32/1000ZM32 = ZASMs(PM,cp,eta,UN)Zl31 = ZsNYYc(6) * 15/1000ZX31 = ZX(18e3,0.92,UN);Z3ges = Zl3 +par(Zl32 + ZM32,Zl31+ZX31)##Zl23 = ZsNYYc(A2) * l23/1000Zl22 = ZsNYYc(A2) * l22/1000Zl21 = ZsNYYc(A2) * l21/1000Z2ges = Zl23 + Zl22 + Zl21##Zl24 = ZsNYYc(A2) * l24/1000##Zl1 = ZsNYYc(A1) * l1/1000ZT1 = ZT(St,0.04)ZQ1 = ZQmax(Sk)ZQges = Zl1 + ZT1 + ZQ1##printLine("Ausgabe 3.1 a)");printLine("Ausgabe Zk");Zges = par(Z3ges, (par(Z2ges,Zl24)+ZQges))printLine("Ikmax an F3");Ikmax = (1.1* UN) / (w3 *Zges)printpol(Ikmax,"A")##printLine("Ausgabe 3.1 b)");printLine("Ik an Sicherung F1")F1 = ITeiler(Ikmax,Z3ges,par(Z2ges,Zl24)+ZQges)printpol(F1,"A")##printLine("Ik an Sicherung F31 & F32");I3 = ITeiler(Ikmax,par(Z2ges,Zl24)+ZQges,Z3ges)printpol(I3,"A")##printLine("F31");F31 = ITeiler(I3,Zl32+ ZM32, Zl31+ZX31)printpol(F31,"A")##printLine("F32");F32 = I3 - F31printpol(F32,"A")##printLine("Ausgabe 3.1 c)");I2 = Ikmax -l3printLine("L23");IL23 = ITeiler(F1,Zl24,Zl23+Zl22+Zl21);printpol(IL23,"A")##printLine("L24");IL24 = ITeiler(F1,Zl23+Zl22+Zl21,Zl24);printpol(IL24,"A")##printLine("Aufgabe 3.2");##Zl3 = ZsNYYw(A3) * l3/1000Zl3_0 = ZsNYYw0(A3) * l3/1000Zl23 = ZsNYYw(A2) * l23/1000Zl23_0 = ZsNYYw0(A2) * l23/1000Zl22 = ZsNYYw(A2) * l22/1000Zl22_0 = ZsNYYw0(A2) * l22/1000Zl21_0 = ZsNYYw0(A2) * l21/1000Zl24 = ZsNYYw(A2) * l24/1000Zl24_0 = ZsNYYw0(A2) * l24/1000Zl1 = ZsNYYw(A1) * l1/1000Zl1_0 = ZsNYYw0(A1) * l1/1000ZT1 = ZT(St,0.04)ZT1_0 = ZT0(St,0.04)ZQ1 = ZQmin(Sk)Zmit = Zl3 + par(Zl24, Zl23+Zl22+Zl21) + Zl1 + ZT1 + ZQ1Zgeg = Zl3 + par(Zl24, Zl23+Zl22+Zl21) + Zl1 + ZT1 + ZQ1Znull = Zl3_0 + par(Zl24_0, Zl23_0+Zl22_0+Zl21_0) + Zl1_0 + ZT1_0Ikmin = w3 *0.95 * UN / (Zmit+ Zgeg+Znull)printpol(Ikmin, "A");